import React from 'react';
import PropTypes from 'prop-types';

// Functional Components
// El parametro es una propiedad.
const PrimeraApp = ( {mensaje} ) => {

    // Variable que puede ser imprimida, React puede mostrar todo tipo de datos excepto booleanos y objetos.
    // const mensaje = 'Hola Mundo';

    // Solo se puede retornar un elemento a la vez, pero usando un fragment puedes adjuntar varios elementos en uno solo.
    return (
        // Esto es un fragment
        <> 
             <h1>{mensaje}</h1>
            <p>Mi Primera Aplicacion en React</p>
        </>
    );

}

export default PrimeraApp;
